import React, { Fragment } from "react";
import { Divider, InputNumber } from "antd";
const Search = () => {
  const SearchOrders = value => {};

  return (
    <Fragment>
      <InputNumber onChange={value => SearchOrders(value)} />
      <Divider />
    </Fragment>
  );
};

export default Search;
